/**
 * @param {string} s
 * @return {number}
 */
var lengthOfLongestSubstring = function(s = '') {
    if (s.length === 0) {
        return 0
    }

    let totalLength = s.length
    let maxLength = 0, endIndex = 0
    const array = []

    while (endIndex < totalLength) {
        const c = s.charAt(endIndex)
        let cIndex = array.indexOf(c)
        if (cIndex >= 0) {
            array.splice(0, cIndex + 1)
        } else {
            array.push(c)
            if (array.length > maxLength) {
                maxLength = array.length
            }
            endIndex++
        }
    }
    console.log(maxLength)
    return maxLength
};

assert.equal(lengthOfLongestSubstring("aa"), 1)
assert.equal(lengthOfLongestSubstring("dvdf"), 3)
assert.equal(lengthOfLongestSubstring("c"), 1)
assert.equal(lengthOfLongestSubstring("abcabcbb"), 3)
assert.equal(lengthOfLongestSubstring("bbbbb"), 1)
assert.equal(lengthOfLongestSubstring("pwwkewabcdabcde"), 7)

